import SeatElement from "../Elements/SeatElement";

function SeastPanel({locomotive, current_wagon_index}) 
{
    return (
      <>
          {current_wagon_index >= 0 ? (
            train.wagon[current_wagon_index].seats.map((seat, index) => (
              <SeatElement key={index} Seat={seat}/>
          ))
          ) : (
            <>
              <h1>{train.locomotive.name}</h1>
            </>
          )}
        {}
      </>
    );
}

  
export default SeastPanel;
